import React from 'react';
import './App.css';
import { BrowserRouter, Route } from 'react-router-dom';
import Welcome from './components/Welcome';

function App() {
  return (
    // <div>Hello World!</div>
    <BrowserRouter>
      <Routes>
        <Route path="/" component={Welcome} exact={true} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
